import logo from './logo.svg';
import './App.css';

import { Box, palette } from '@material-ui/core';

function App() {
  return (
    <Box className="center" bgcolor="primary.main">
      <ul>
        <li>Home</li>
        <li>Menu</li>
        <li>Promotions</li>
      </ul>
    </Box>
  );
}

